import React, { Component } from 'react'

// import ParticlesBg from 'particles-bg'
import MouseParticles from "react-mouse-particles";

class Opening extends Component {
  constructor() {
    super();
    this.state = {
      name: "React"
    };
  }

  render () {
    return (
      <>
        <div>
          <img src="https://cdn.mos.cms.futurecdn.net/M7fDTpDnJcZ4dt3myngzxi.jpg" alt="" />
        <MouseParticles
          g={2.3}
          num={1}
          radius={8}
          life={0.8}
          v={1.2}
          color="random"
          alpha={0.16}
          level={6}
        />
        </div>
      </>
    )
  }
}

export default Opening
